import React from "react";
import { Form } from "./form";
import styled, { css } from 'styled-components';
import {Title} from './title';

const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    @media only all and (max-width: 1440px) {
        max-width: 100%!important;
        flex: 0 0 100%!important;
    }
    & iframe{
        margin-bottom: 40px;
    }
`;
const TitleGuarda = styled.div`
    font-weight: bold;
    font-size: 34px;
    line-height: 41px;
    text-transform: uppercase;
    color: #FFFFFF;
    margin-top: 40px;
    margin-bottom: 24px;
`;
const AddressContainer = styled.div`
    margin-top: 40px;
    margin-bottom: 60px;

`;
const Address = styled.div`
    @media only all and (max-width: 500px) {
        flex: 0 0 10%;
        max-width: 10%;
    }
`;
const AddressBlock = styled.div`
    font-weight: normal;
    font-size: 18px;
    margin-left: 15px;
    margin-top: 30px;
    & >a{color: #fff;}
    & >a:hover{color: #007bff;}
    @media only all and (max-width: 500px) {
        margin-top: 50px;
    }
    ${props => props.none2 && css`
        margin-top: 17px;
        @media only all and (max-width: 500px) {
            margin-top: 12px;
        }
    `}
    ${props => props.two && css`
        margin-top: 63px;
         @media only all and (max-width: 500px) {
            margin-top: 72px;
         }
    `}
    ${props => props.none && css`
        margin-top: 0px;
        @media only all and (max-width: 500px) {
            margin-top: 0px;
        }
    `}
`;
const SmallIcon = styled.img`
    width: 30px;
    height: 30px;
    margin-top: 60px;
    margin-left: 20px;
    margin-right: 20px;
    @media only all and (max-width: 500px) {
        margin-top: 70px;
        margin-left: 0px;
        margin-right: 0px;
    }
    ${props => props.none && css`
        margin-top: 15px;
        @media only all and (max-width: 500px) {
            margin-top: 10px;
        }
    `}

`;
const Line = styled.div`
    width: 2px;
    height: 245px;
    background: #828282;
    @media only all and (max-width: 500px) {
        display: none; 
    }
`;
const TitileContact = styled.div`
    font-weight: bold;
    font-size: 20px;
`;
const TextContact = styled.div`
    font-weight: normal;
    font-size: 18px;
    margin-top: -7px;

`;
const ContainerMargin = styled.div`
    margin-top: 40px;
`;
function Contatti() {
    return(
        <>
        <Title/>
        <Container className="col-sm-8 mx-auto row">
            <TitleGuarda className="mx-auto text-center col-sm-12">CONTATTI</TitleGuarda>
            <AddressContainer className="row col-sm-12">
                <div className="col-sm-3 mx-auto row">
                    <Address className="col-3 p-0">
                        <SmallIcon src="/static/images/location.svg" none></SmallIcon>
                        <SmallIcon src="/static/images/location.svg"></SmallIcon>
                        <SmallIcon src="/static/images/location.svg"></SmallIcon>
                    </Address>
                    <Line></Line>
                    <div className="col">
                        <AddressBlock none>
                            <TitileContact>TRENTO</TitileContact>
                            <TextContact>Via Praga N. 5</TextContact>
                        </AddressBlock>
                        <AddressBlock>
                            <TitileContact>SEREGNO</TitileContact>
                            <TextContact>Via Montorfano N.74/76</TextContact>
                        </AddressBlock>
                        <AddressBlock>
                            <TitileContact>OLBIA</TitileContact>
                            <TextContact>Via Liguria N.1</TextContact>
                        </AddressBlock>
                    </div>
                </div>
                <ContainerMargin className="col-sm-3 mx-auto row">
                    <Address className="col-3 p-0">
                        <SmallIcon src="/static/images/whatsapp.svg" none></SmallIcon>
                        <SmallIcon src="/static/images/facebook.svg"></SmallIcon>
                        <a href="https://www.youtube.com/channel/UCRS0cuSeg3y2w6Hq7rQsOvg/featured" target="_blank"><SmallIcon src="/static/images/youtube.svg"></SmallIcon></a>
                    </Address>
                    <Line></Line>
                    <div className="col">
                        <AddressBlock none2>+39 393 989 3909</AddressBlock>
                        <AddressBlock two>@nickname</AddressBlock>
                        <AddressBlock two><a href="https://www.youtube.com/channel/UCRS0cuSeg3y2w6Hq7rQsOvg/featured" target="_blank">PALPONAUTO</a></AddressBlock>
                    </div>
                </ContainerMargin>
                <ContainerMargin className="col-sm-3 mx-auto row">
                    <Address className="col-3 p-0">
                        <SmallIcon src="/static/images/mail.png" none></SmallIcon>
                    </Address>
                    <Line></Line>
                    <div className="col p-0">
                        <AddressBlock none2>fabrizio@tanteauto.it</AddressBlock>
                    </div>
                </ContainerMargin>
            </AddressContainer>
            <iframe className="mx-auto" width="980" height="430" src="https://maps.google.com/maps?width=980&amp;height=430&amp;hl=en&amp;q=Via%20Montorfano%2C%2074%2F76%2C%2020831%20Seregno%20MB%2C%20Italy+(%D0%9D%D0%B0%D0%B7%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5)&amp;ie=UTF8&amp;t=&amp;z=10&amp;iwloc=B&amp;output=embed" frameBorder="0" scrolling="no"></iframe>     
        </Container>
        <div className="row d-flex justify-content-center">
            <Form/>
        </div>
        </>
    );
}
export {Contatti};
